import jsPDF from 'jspdf';
import autoTable from 'jspdf-autotable';
import { Customer, Job, JobItem, Quote, QuoteItem, InvoiceItem } from '../types';

// Provided Logo Base64 (Condon Dairy Services / DeLaval)
const LOGO_BASE64 = 'data:image/png;base64,';

// Helper: Add Logo
const addLogo = (doc: jsPDF) => {
    const logoWidth = 85;
    const logoHeight = 34;
    const x = doc.internal.pageSize.width - 95;
    const y = 8;
    doc.addImage(LOGO_BASE64, 'JPEG', x, y, logoWidth, logoHeight);
};

// Helper: Add Status Banner (Triangle) - Matching Example PDF
const addStatusBanner = (doc: jsPDF, status: string) => {
    const isPaid = status.toUpperCase() === 'PAID';
    const bannerText = status.toUpperCase();

    // Sample colors: Green (#22c55e) for Paid, Orange (#ff8c00) for Unpaid/Draft
    const bannerColor = isPaid ? [34, 197, 94] : [255, 140, 0];

    doc.setFillColor(bannerColor[0], bannerColor[1], bannerColor[2]);
    // Diagonal strip (15 units wide)
    doc.triangle(0, 24, 0, 39, 39, 0, 'F');
    doc.triangle(39, 0, 24, 0, 0, 24, 'F');

    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.setTextColor(255, 255, 255);
    // Aligning text from down to up (45 degree angle), final adjustment
    doc.text(bannerText, 8, 25, { angle: 45 });
};

// Header Section Helper
const addHeader = (doc: jsPDF, title: string, documentNumber: string, status?: string) => {
    let yPos = 30;
    addLogo(doc);
    if (status) addStatusBanner(doc, status);

    doc.setFont("helvetica", "bold");
    doc.setFontSize(24);
    doc.setTextColor(30, 30, 30);
    doc.text(String(title), 20, yPos);

    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.setTextColor(0, 0, 0);
    doc.text(String(documentNumber), 20, yPos + 8);

    return yPos + 25;
};

// Address Section Helper (3 columns layout as in example)
const addAddressSection = (doc: jsPDF, customer: Customer, yPos: number, type: string = 'Invoice') => {
    const pageWidth = doc.internal.pageSize.width;
    const leftMargin = 20;
    const columnWidth = (pageWidth - 40) / 3;

    doc.setTextColor(0, 0, 0);

    // Column 1: Bill To
    doc.setFont("helvetica", "bold");
    doc.setFontSize(9);
    const billToLabel = type === 'Quote' ? 'Quote For:' : 'Invoice To:';
    doc.text(String(billToLabel), leftMargin, yPos);
    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    doc.text(String(customer.name || "Cash Sale"), leftMargin, yPos + 5);
    if (customer.address) {
        const addressLines = doc.splitTextToSize(String(customer.address), columnWidth - 10);
        doc.text(addressLines, leftMargin, yPos + 10);
    }

    // Column 2: Deliver To
    doc.setFont("helvetica", "bold");
    doc.setFontSize(9);
    doc.text("Deliver To:", leftMargin + columnWidth, yPos);
    doc.setFont("helvetica", "normal");
    doc.setFontSize(10);
    doc.text(String(customer.name || "Cash Sale"), leftMargin + columnWidth, yPos + 5);
    if (customer.address) {
        const addressLines = doc.splitTextToSize(String(customer.address), columnWidth - 10);
        doc.text(addressLines, leftMargin + columnWidth, yPos + 10);
    }

    // Column 3: Company Details
    doc.setFont("helvetica", "bold");
    doc.setFontSize(9);
    doc.text("Condon Dairy Agri Ltd", leftMargin + (columnWidth * 2), yPos);
    doc.setFont("helvetica", "normal");
    doc.setFontSize(9);
    const details = [
        "Clonegogaile, Ballinamult",
        "Co. Tipperary, E91 P5P6",
        "Tel: (052) 915 6345",
        "Email: info@condondairy.ie",
        "Web: www.condondairy.ie"
    ];
    let detailY = yPos + 5;
    details.forEach(line => {
        doc.text(String(line), leftMargin + (columnWidth * 2), detailY);
        detailY += 4;
    });

    return yPos + 35;
};

// Info Row Grid Helper (6 columns as in example)
const addInfoGrid = (doc: jsPDF, data: { label: string, value: string }[], yPos: number) => {
    const pageWidth = doc.internal.pageSize.width;
    const leftMargin = 20;
    const rightMargin = 20;
    const width = pageWidth - leftMargin - rightMargin;
    const colWidth = width / 6;

    // Drawing separation lines
    doc.setDrawColor(200, 200, 200);
    doc.setLineWidth(0.5);
    doc.line(leftMargin, yPos - 5, pageWidth - rightMargin, yPos - 5);

    doc.setFontSize(8);
    data.forEach((item, i) => {
        const x = leftMargin + (i * colWidth);
        doc.setFont("helvetica", "bold");
        doc.setTextColor(80, 80, 80);
        doc.text(String(item.label), x, yPos);
        doc.setFont("helvetica", "normal");
        doc.setTextColor(0, 0, 0);
        doc.text(String(item.value), x, yPos + 5);
    });

    doc.line(leftMargin, yPos + 10, pageWidth - rightMargin, yPos + 10);

    return yPos + 25;
};

// VAT Analysis Summary Table
const addVATAnalysis = (doc: jsPDF, vatRate: number, net: number, vat: number, yPos: number) => {
    const leftMargin = 20;

    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.setTextColor(0, 0, 0);
    doc.text("VAT Analysis", leftMargin, yPos);

    autoTable(doc, {
        startY: yPos + 4,
        head: [['VAT Rate %', 'Net', 'VAT', 'Gross']],
        body: [[
            `${vatRate.toFixed(2)}%`,
            `${net.toFixed(2)}`,
            `${vat.toFixed(2)}`,
            `${(net + vat).toFixed(2)}`
        ]],
        theme: 'grid',
        styles: { fontSize: 8, cellPadding: 2 },
        headStyles: { fillColor: [240, 240, 240], textColor: [0, 0, 0], fontStyle: 'bold' },
        margin: { left: leftMargin },
        tableWidth: 85
    });
    // @ts-ignore
    return doc.lastAutoTable.finalY + 10;
};

// Bank Details Section
const addBankDetails = (doc: jsPDF, yPos: number) => {
    const leftMargin = 20;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(10);
    doc.text("Bank Details", leftMargin, yPos);

    doc.setFont("helvetica", "normal");
    doc.setFontSize(8);
    const bankInfo = [
        ["Account Name:", "Condon Dairy Agri Ltd"],
        ["Bank Name:", "AIB"],
        ["BIC/SWIFT:", "AIBK IE 2D"],
        ["IBAN:", "IE84 AIBK 9340 7031 9910 99"]
    ];

    let bankY = yPos + 5;
    bankInfo.forEach(line => {
        doc.setFont("helvetica", "bold");
        doc.text(String(line[0]), leftMargin, bankY);
        doc.setFont("helvetica", "normal");
        doc.text(String(line[1]), leftMargin + 25, bankY);
        bankY += 4;
    });

    return bankY + 10;
};

// Footer Section
const addFooter = (doc: jsPDF) => {
    const totalPages = (doc.internal as any).getNumberOfPages();
    const pageHeight = doc.internal.pageSize.height;
    const pageWidth = doc.internal.pageSize.width;
    const leftMargin = 20;

    const today = new Date().toLocaleDateString('en-GB', { day: '2-digit', month: '2-digit', year: 'numeric' });

    for (let i = 1; i <= totalPages; i++) {
        doc.setPage(i);
        doc.setFont("helvetica", "normal");
        doc.setFontSize(8);
        doc.setTextColor(150, 150, 150);
        doc.text(`Printed as: ${today} | Page ${i} of ${totalPages}`, leftMargin, pageHeight - 10);
        doc.text("Created by Condon Dairy Services Invoice Hub", pageWidth - 20, pageHeight - 10, { align: 'right' });
    }
};

// Standard Invoice Generator
export const generateInvoice = (documentNumber: string, customer: Customer, items: (InvoiceItem | JobItem)[], vatRate: number, totalAmount: number, action: 'download' | 'preview' = 'download', paymentStatus: string = 'UNPAID', engineerName?: string) => {
    const doc = new jsPDF();
    doc.setProperties({ title: `${documentNumber}` });
    let y = addHeader(doc, 'Invoice', documentNumber, paymentStatus);
    y = addAddressSection(doc, customer, y, 'Invoice');

    const infoData = [
        { label: "Invoice Date", value: new Date().toLocaleDateString('en-GB') },
        { label: "Ref. No.", value: String(documentNumber) },
        { label: "Account Manager", value: String(engineerName || "Prince Gaur") },
        { label: "VAT No.", value: "IE 8252470Q" },
        { label: "Payment Due", value: "Net 30" },
        { label: "Credit Terms", value: String(customer.payment_terms || "30 Days") }
    ];
    y = addInfoGrid(doc, infoData, y);

    const netAmount = totalAmount / (1 + vatRate / 100);
    const vatAmount = totalAmount - netAmount;

    autoTable(doc, {
        startY: y,
        head: [['Description', 'Quantity', 'Price', 'VAT Rate', 'Total']],
        body: items.map(item => {
            const unitPrice = 'unit_price' in item ? (item as any).unit_price : (item as any).unit_price;
            const total = item.quantity * unitPrice;
            return [String(item.description), String(item.quantity), `${unitPrice.toFixed(2)}`, `${vatRate}%`, `${total.toFixed(2)}`];
        }),
        theme: 'plain',
        styles: { fontSize: 10, cellPadding: 3 },
        headStyles: { fillColor: [245, 245, 245], fontStyle: 'bold' },
        columnStyles: { 1: { halign: 'center' }, 2: { halign: 'right' }, 3: { halign: 'center' }, 4: { halign: 'right' } }
    });

    // @ts-ignore
    y = doc.lastAutoTable.finalY + 15;
    const totalsX = doc.internal.pageSize.width - 70;

    const totals = [
        ["Total Net", `${netAmount.toFixed(2)}`],
        ["Total Discount", "0.00"],
        ["Total VAT", `${vatAmount.toFixed(2)}`],
        ["Total Gross", `${totalAmount.toFixed(2)}`],
        ["Less Deposit", "0.00"]
    ];

    totals.forEach(row => {
        doc.setFont("helvetica", "normal");
        doc.text(String(row[0]), totalsX, y);
        doc.text(String(row[1]), doc.internal.pageSize.width - 20, y, { align: 'right' });
        y += 6;
    });

    y += 4;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.text("Total Payable", totalsX, y);
    doc.text(`${totalAmount.toFixed(2)}`, doc.internal.pageSize.width - 20, y, { align: 'right' });

    y = addVATAnalysis(doc, vatRate, netAmount, vatAmount, y);

    // Check if Bank Details fit on the current page
    const bankDetailsHeight = 30;
    if (y + bankDetailsHeight > doc.internal.pageSize.height - 20) {
        doc.addPage();
        y = 20;
    } else {
        // Ensure bank details are at least at the bottom if there is space, but don't overlap
        y = Math.max(y, doc.internal.pageSize.height - 60);
    }

    addBankDetails(doc, y);
    addFooter(doc);

    return action === 'preview' ? (doc.output('bloburl') as unknown as string) : (doc.save(`${documentNumber}.pdf`) as unknown as void);
};

// Standard Quote Generator
export const generateQuote = (quote: Quote, customer: Customer, items: QuoteItem[], action: 'download' | 'preview' = 'download') => {
    const doc = new jsPDF();
    doc.setProperties({ title: `${quote.quote_number}` });
    let y = addHeader(doc, 'Quotation', String(quote.quote_number));
    y = addAddressSection(doc, customer, y, 'Quote');

    const infoData = [
        { label: "Quote Date", value: new Date(quote.date_issued).toLocaleDateString('en-GB') },
        { label: "Ref. No.", value: String(quote.quote_number) },
        { label: "Account Manager", value: "Prince Gaur" },
        { label: "VAT No.", value: "IE 8252470Q" },
        { label: "Valid Until", value: "30 Days" },
        { label: "Terms", value: String(customer.payment_terms || "On Receipt") }
    ];
    y = addInfoGrid(doc, infoData, y);

    autoTable(doc, {
        startY: y,
        head: [['Description', 'Qty', 'Price', 'Total']],
        body: items.map(i => [String(i.description), String(i.quantity), `${i.unit_price.toFixed(2)}`, `${i.total.toFixed(2)}`]),
        theme: 'plain',
        styles: { fontSize: 10, cellPadding: 3 },
        headStyles: { fillColor: [245, 245, 245], fontStyle: 'bold' },
        columnStyles: { 3: { halign: 'right' } }
    });

    // @ts-ignore
    y = doc.lastAutoTable.finalY + 15;
    doc.setFont("helvetica", "bold");
    doc.text('Quote Total:', doc.internal.pageSize.width - 80, y);
    doc.text(`${quote.total_amount.toFixed(2)}`, doc.internal.pageSize.width - 20, y, { align: 'right' });

    addBankDetails(doc, doc.internal.pageSize.height - 60);
    addFooter(doc);

    return action === 'preview' ? (doc.output('bloburl') as unknown as string) : (doc.save(`${quote.quote_number}.pdf`) as unknown as void);
};

// Customer Statement Generator
export const generateStatement = (job: Job, items: JobItem[], customer: Customer, action: 'download' | 'preview' = 'download') => {
    const doc = new jsPDF();
    const documentNumber = `STMT-${job.job_number}`;
    doc.setProperties({ title: `${documentNumber}` });
    let y = addHeader(doc, 'Statement', documentNumber);
    y = addAddressSection(doc, customer, y, 'Statement');

    const infoData = [
        { label: "Statement Date", value: new Date().toLocaleDateString('en-GB') },
        { label: "Ref. No.", value: String(job.job_number) },
        { label: "Account", value: "Admin" },
        { label: "VAT No.", value: "IE 8252470Q" },
        { label: "Service", value: String(job.service_type || "General") },
        { label: "Terms", value: "On Receipt" }
    ];
    y = addInfoGrid(doc, infoData, y);

    autoTable(doc, {
        startY: y,
        head: [['Description', 'Qty', 'Price', 'Total']],
        body: items.map(item => [String(item.description), String(item.quantity), `${item.unit_price.toFixed(2)}`, `${item.total.toFixed(2)}`]),
        theme: 'plain',
        styles: { fontSize: 10, font: "helvetica" },
        headStyles: { fillColor: [245, 245, 245], fontStyle: 'bold' },
        columnStyles: { 3: { halign: 'right' } }
    });

    const subtotal = items.reduce((sum, item) => sum + item.total, 0);
    // @ts-ignore
    y = doc.lastAutoTable.finalY + 15;
    doc.setFont("helvetica", "bold");
    doc.text('Total Value:', doc.internal.pageSize.width - 80, y);
    doc.text(`${subtotal.toFixed(2)}`, doc.internal.pageSize.width - 20, y, { align: 'right' });

    addBankDetails(doc, doc.internal.pageSize.height - 60);
    addFooter(doc);

    return action === 'preview' ? (doc.output('bloburl') as unknown as string) : (doc.save(`${documentNumber}.pdf`) as unknown as void);
};

// Quick/One-Time Invoice Generator
export const generateOneTimeInvoice = (data: any, items: any[], action: 'download' | 'preview' = 'download') => {
    const doc = new jsPDF();
    const { customerName, total, address } = data;
    const invNum = `INV-QUICK-${Math.floor(1000 + Math.random() * 9000)}`;
    doc.setProperties({ title: `${invNum}` });
    let y = addHeader(doc, 'Tax Invoice', invNum, 'UNPAID');

    const mockCustomer: Customer = {
        id: 'guest',
        name: customerName,
        email: '',
        phone: '',
        address: address || '',
        created_at: new Date().toISOString(),
        account_balance: 0,
        payment_terms: 'On Receipt'
    };
    y = addAddressSection(doc, mockCustomer, y, 'Invoice');

    const infoData = [
        { label: "Date", value: new Date().toLocaleDateString('en-GB') },
        { label: "Ref. No.", value: String(invNum) },
        { label: "Account", value: "Quick Sale" },
        { label: "VAT No.", value: "IE 8252470Q" },
        { label: "Terms", value: "On Receipt" },
        { label: "Payment", value: "Required" }
    ];
    y = addInfoGrid(doc, infoData, y);

    autoTable(doc, {
        startY: y,
        head: [['Description', 'Qty', 'Price', 'Total']],
        body: items.map(item => [String(item.description), String(item.quantity), `${item.unitPrice.toFixed(2)}`, `${(item.quantity * item.unitPrice).toFixed(2)}`]),
        theme: 'plain',
        styles: { fontSize: 10 },
        headStyles: { fillColor: [245, 245, 245], fontStyle: 'bold' },
        columnStyles: { 3: { halign: 'right' } }
    });

    // @ts-ignore
    y = doc.lastAutoTable.finalY + 15;
    doc.setFont("helvetica", "bold");
    doc.setFontSize(12);
    doc.text('Total Payable:', doc.internal.pageSize.width - 80, y);
    doc.text(`${total.toFixed(2)}`, doc.internal.pageSize.width - 20, y, { align: 'right' });

    addBankDetails(doc, doc.internal.pageSize.height - 60);
    addFooter(doc);

    return action === 'preview' ? (doc.output('bloburl') as unknown as string) : (doc.save(`${invNum}.pdf`) as unknown as void);
};
